import React, {useState} from 'react';

const SearchResDropDown = ({result, setQuery, setSearch}) => {

    if (result.length <= 0){
        return(<div></div>);
    }
    else {
    return(
        <div className="py-1" role="none">
            {result.map((child) => {
                <IndividualListings 
                result={child} 
                setQuery={setQuery} 
                setSearch={setSearch}
                />
            })}
        </div>
    );
    }
}

const IndividualListings = ({result, setQuery, setSearch}) => {

    return (
        <a href={() => {setSearch(""); setQuery(result.display_name_prefixed)}} 
        className="block px-4 py-2 text-base text-gray-700 hover:bg-gray-100 hover:text-gray-900" 
        role="menuitem"
        >{result.display_name_prefixed}</a>
    )
}
